import React, { useEffect, useState } from 'react'
import Axios from 'axios';

function VerifyEvents() {
    const [toVerifylist,setToverifylist] = useState([]);
    useEffect(() => {
        Axios.get('http://localhost:3001/getNoneVerifiedEvents')
        .then((res)=>{
            setToverifylist(res.data);
        })
        .catch((err)=>{
            alert(err);
        })
    }, [setToverifylist]);
    return (
        <div>
            <h2>Verify Events</h2>
            <div>
                {
                    toVerifylist.forEach((ele)=>{
                        <div>{ele.ename}</div>
                    })
                }
            </div>
            {console.log(toVerifylist)}
        </div>
    )
}

export default VerifyEvents
